import React from 'react';
import '../../App.css';
import './css/Home.css';

function Home() {
  return (
    <div className="home">
      <div className="home-section">
        <h1>about speare</h1>
        <p>
          Speare is a computer language. You know that, I know that, we all know that. 
          But what can we say here that will make anyone who visits our page say “ooooh 
          that’s cool” because we know nothing that we say about the language will make
          them go “wow I really wanna use that now”
          </p>
      </div>
    </div>
  )
}

export default Home;
